  const [foodName, setfoodName] = useState('');

  const inputHandler = (e) => {
    setfoodName(e.target.value);
  }

  const onSubmit = () => {
    console.log(foodName)
  }


  return (
    <div className="App">
        <input type="text" value={foodName} onChange={inputHandler}/>
        <input type="submit" onClick={onSubmit}/>
    </div>
  );
}

export default App;
